import React from "react";
import './Menubar.css';
import { Link } from "react-router-dom";
import LinkButton from "./../../Components/LinkButton/LinkButton";
const Menubar = ()=>{

    return(
        <div id="verticalmenu" className="verticalmenu">
            <div className="profilesection">
                    <div className="profilephoto">
                        <div className="head"></div>
                        <div className="body"></div>
                        <img src="" alt=""/>
                    </div>
                    <label style={{fontWeight:"700",padding:"10px 0 0 20px"}}>Account UserName</label>
            </div>
                    <div style={{width:"100%",display:"flex",justifyContent:"flex-end",alignItems:"center"}}>
                    <Link style={{width:"200px",textDecoration:"none",alignItems:"center",justifyContent:"center",display:"flex"}}><LinkButton>Login</LinkButton></Link>                
                    <Link style={{width:"200px",textDecoration:"none",alignItems:"center",justifyContent:"center",display:"flex"}}><LinkButton>Sign up</LinkButton></Link>
                    </div>
            <div>

            </div>
    </div>
    );
}
export default Menubar;
